/* 显示执行用户类型的列表信息 */
import React from "react";
import PropTypes from "prop-types";
import { WingBlank } from "antd-mobile";

class UserList extends React.Component {
  static propTypes = {
    userList: PropTypes.array.isRequired,
  };
  render() {
    return (
      <div>
        <WingBlank></WingBlank>
      </div>
    );
  }
}

export default UserList;
